Information
------------------------------

Discovering: Bryan Ferry
Documentary exploring the life and career of Roxy Music frontman Bryan Ferry,
A rather miserly half-hour is allotted for a career overview of the Roxy Musician turned suave soloist. With his unique, sat-on-a-washing-machine vibrato, the singer has gone from sci-fi art rocker to mid-tempo crooner and from working-class upbringing to tuxedoed high society. Music critics weigh up the influence of pop's Slave to Love and Jealous Guy, the unswerving vision he had for his group and the impact of their 1972 debut single Virginia Plain, notable for its pounded piano and early, Brian Eno synths.

